VALUES ('3413880081033', 'Quinoa real blanc', 'Le quinoa real équitable se caractérise par son gros grain moelleux au goût inimitable aux notes d\'amandes. ANAPQUI, Première coopérative de Bolivie, est notre partenaire depuis plus de 20 ans. Elle regroupe aujourd\'hui plus de 2000 producteurs. « Jiliri Mallcu » est le chef coutumier. Il veille à l\'équité entres les producteurs au sein des communautés. Il est le protecteur de la Pache Mama» (Terre Nourricière) ; il s\'assure que les pratiques agricoles sont respectueuses de la nature. DEVENEZ ARTISANS DU MONDE :  Nous changeons les règles du commerce international depuis 1974 grâce à nos milliers de bénévoles. Nous agissons par la vente de produits équitables distribués exclusivement en magasins - bio et équitables. par la sensibilisation des citoyens et par des campagnes de mobilisation. Conseils de cuisson : Porter à ébullition pendant 12 à 15 minutes dans 2 fois son volume d\'eau. Saler en fin de cuisson.', 'https://static.openfoodfacts.org/images/products/341/388/008/1033/front_fr.9.400.jpg', '5', '0.5', '58.5', '1.8', '6.6', '14.8', '0.02', '0.0078740157480315', '', '1');

