VALUES ('3413880081279', 'Quinoa real rouge', 'Découvrez notre quinoa real rouge équitable. Sans gluten et source de protéines végétales. il se caractérise par son gros grain moelleux au goût inimitable aux notes d\'amande. Plus croquant que le quinoa blanc, il donnera de la couleur à vos taboulés et à tous vos mets ! Anapqui, première coopérative de Bolivie, est notre partenaire depuis plus de 20 ans. Elle regroupe aujourd\'hui plus de 2000 producteurs de quinoa. Artisans du Monde co-finance un programme de réintroduction des lamas sur 4 ans. Depuis juillet 2016, nos premiers 42 jeunes lamas paissent dans la région d\'Uyuni. Notre projet a pour but de réinitier un juste équilibre entre cultures et élevage. DEVENEZ Nous changeons les international depuis 1974 grâce à nos Nous agissonso par la vente de produits exclusivement en magasins bio et des citoyens et par des Conseils de cuisson : Porter à ébultitioru pendant 12 à 15 minutes dans 2 fois son volume d\'eau. Saler en fin de cuisson. SACHET PENSEZ PLASTIQUE AU TRI ! A JETER', 'https://static.openfoodfacts.org/images/products/341/388/008/1279/front_fr.4.400.jpg', '6.7', '1', '54.4', '0.7', '13.6', '13.5', '0', '0', '', '1');

